from collections import defaultdict

def find_secret_number(matrix, width, height):
    d = defaultdict(str)
    for y in range(height - 1, -1, -1):
        for x in range(width - 1, -1, -1):
            if '0' <= matrix[y][x] <= '9':
                d[x, y] = matrix[y][x]
    for y in range(height - 1, -1, -1):
        for x in range(width - 1, -1, -1):
            if '0' <= matrix[y][x] <= '9':
                if len(d[x + 1, y]) == len(d[x, y + 1]):
                    d[x, y] = matrix[y][x] + max(d[x + 1, y], d[x, y + 1])
                elif len(d[x + 1, y]) < len(d[x, y + 1]):
                    d[x, y] = matrix[y][x] + d[x, y + 1]
                else:
                    d[x, y] = matrix[y][x] + d[x + 1, y]
    secret_number = 1
    for v in d.values():
        if v == '':
            continue
        secret_number = max(secret_number, int(v))
    return secret_number

